import { Injectable } from "@angular/core";

@Injectable({
  providedIn: "root",
})
export class AuthService {
  constructor(private router: Router) {}

  login(username: string, password: string) {
    if (username === "admin" && password === "admin") {
      return 200;
    } else {
      return 403;
    }
  }

  logout() {}
}
